script: |
  super -f text -I q764.spq | sort > q764.out

inputs:
  - name: q764.spq
    data: |
      SELECT DISTINCT - col0 FROM tab0 (FORMAT parquet) WHERE NOT - col2 / + col1 - + col1 - + + col0 BETWEEN NULL AND + 52 / + - CAST ( NULL AS INTEGER ) + - 80;
  - name: tab0

outputs:
  - name: q764.out
    data: |
